BOOST_AUTO_TEST_CASE(empty_constructor)
{
	NGram ngram;
	BOOST_CHECK_EQUAL(ngram.getCount(), 0);
	BOOST_CHECK_EQUAL(ngram.getConfiguration().getEmbeddingType(), COUNT);
	BOOST_CHECK_EQUAL(ngram.getConfiguration().getLength(), 1);
}

BOOST_AUTO_TEST_CASE(copy_constructor)
{
	NGramConf conf(BINARY, 3);
	NGram ngram(conf);
	NGram copy_ngram(ngram);
	BOOST_CHECK_EQUAL(ngram, copy_ngram);
}

BOOST_AUTO_TEST_CASE(conf_constructor)
{
	NGramConf conf(BINARY, 3);
	NGram ngram(conf);
	BOOST_CHECK_EQUAL(ngram.getConfiguration(), conf);
	BOOST_CHECK_EQUAL(ngram.getConfiguration().getEmbeddingType(), BINARY);
	BOOST_CHECK_EQUAL(ngram.getConfiguration().getLength(), 3);
}

BOOST_AUTO_TEST_CASE(string_constructor)
{
	NGramConf conf(BINARY, 4);
	NGram ngram(conf, "aaaaaaab", 8);
	BOOST_CHECK_EQUAL(ngram.getConfiguration(), NGramConf(BINARY, 4));
	BOOST_CHECK_EQUAL(ngram.getCount(), 2);

	// Input too short
	try {
		NGram a(conf, "aa", 2);
		// Should not get run
		throw "Uncatched exception - Input too short";
	} catch (...) {
	}
}

BOOST_AUTO_TEST_CASE(clone_function)
{
	// Initialized
	NGram ngram(NGramConf(BINARY, 2), "aa", 2);
	NGram clone(ngram.clone());
	BOOST_CHECK_EQUAL(ngram, clone);

	// Uninitialized
	NGram ngram2(NGramConf(BINARY, 4));
	NGram clone2(ngram2.clone());
	BOOST_CHECK_EQUAL(ngram2, clone2);
}

BOOST_AUTO_TEST_CASE(operator_assignment)
{
	// Self-assignment
	NGram a;
	a = a;

	NGram b(NGramConf(COUNT, 3), "aaa", 3);
	a = b;
	BOOST_CHECK_EQUAL(a, b);
}

BOOST_AUTO_TEST_CASE(operator_plus_equals)
{
	NGramConf conf(COUNT, 1);
	NGram a(conf, "aaabbb", 6);
	NGram b(conf, "aaaddd", 6);

	NGram a_old(a);
	a += b;
	BOOST_CHECK_EQUAL(a, a_old += b);
	BOOST_CHECK_EQUAL(a, NGram(conf, "dddaaaaaabbb", 12));
}

BOOST_AUTO_TEST_CASE(operator_minus_equals)
{
	NGramConf conf(COUNT, 1);
	NGram a(conf, "bdadbaadb", 9);
	NGram b(conf, "aaa", 3);

	NGram a_old(a);
	a -= b;
	BOOST_CHECK_EQUAL(a, a_old -= b);
	BOOST_CHECK_EQUAL(a, NGram(conf, "bdbddb", 6));

	a -= a;
	BOOST_CHECK_EQUAL(a, NGram(conf));
}

BOOST_AUTO_TEST_CASE(operator_star_equals)
{
	NGramConf conf(COUNT, 1);
	NGram a(conf, "bdadbaadb", 9);

	// Multiplication by zero
	try {
		a *= 0.0;
		// Should not get run
		throw "Uncatched exception - Multiplication by zero";
	} catch (...) {
	}

	NGram a_old(a);
	a *= 2.0;
	BOOST_CHECK_EQUAL(a, a_old *= 2.0);
	BOOST_CHECK_EQUAL(a, NGram(conf, "bdadbaadbbdadbaadb", 18));
}

BOOST_AUTO_TEST_CASE(operator_equality)
{
	NGramConf conf(COUNT, 1);
	NGram a(conf, "aaabbb", 6);
	NGram b(conf, "ababba", 6);
	NGram c(conf, "ccc", 3);

	BOOST_CHECK_EQUAL(a == b, true);
	BOOST_CHECK_EQUAL(a == a, true);
	BOOST_CHECK_EQUAL(a == c, false);
	BOOST_CHECK_EQUAL(c == b, false);
}

BOOST_AUTO_TEST_CASE(operator_star)
{
	NGramConf conf(COUNT, 1);
	NGram a(conf, "aaabbb", 6);
	NGram b(conf, "caadddd", 7);

	BOOST_CHECK_EQUAL(a * a, 18.0);
	BOOST_CHECK_EQUAL(a * b, 6.0);
}

BOOST_AUTO_TEST_CASE(l1norm)
{
	NGramConf conf(COUNT, 1);
	NGram a(conf, "aaabbb", 6);
	NGram b(conf);

	BOOST_CHECK_EQUAL(a.L1norm(), 6.0);
	BOOST_CHECK_EQUAL(b.L1norm(), 0.0);
}

BOOST_AUTO_TEST_CASE(l2norm)
{
	NGramConf conf(COUNT, 1);
	NGram a(conf, "aaabbb", 6);
	NGram b(conf);

	BOOST_CHECK_EQUAL(a.L2norm(), std::sqrt(18.0));
	BOOST_CHECK_EQUAL(b.L2norm(), 0.0);
}

BOOST_AUTO_TEST_CASE(trim)
{
	NGramConf conf(COUNT, 1);
	NGram a(conf, "abbbbb", 6);
	a.trim(2.0, 3.0);
	BOOST_CHECK_EQUAL(a, NGram(conf, "aabbb", 5));

	NGram b(conf, "c", 1);
	a -= b;
	a.trim(0.0, 1.0);
	NGram c(conf, "ab", 2);
	BOOST_CHECK_EQUAL(a, c);
}

BOOST_AUTO_TEST_CASE(getTopN)
{
	NGramConf conf(COUNT, 1);
	// a2 b4 c5 d1 e6 f3
	NGram a(conf, "abbccbbccfeceeeaffeed", 21);

	// Mind your 'n'
	try {
		a.getTopN(0);
		throw "Uncatched exception - Mind your 'n'";
	} catch (...) {
	}

	// Mind your 'n'
	try {
		a.getTopN(7);
		throw "Uncatched exception - Mind your 'n'";
	} catch (...) {
	}

	BOOST_CHECK_EQUAL(a.getCount(), 6);

	std::vector<NGramItem> v;
	v.push_back(NGramItem((unsigned long) 'e', 6));
	v.push_back(NGramItem((unsigned long) 'c', 5));
	v.push_back(NGramItem((unsigned long) 'b', 4));
	v.push_back(NGramItem((unsigned long) 'f', 3));
	v.push_back(NGramItem((unsigned long) 'a', 2));
	v.push_back(NGramItem((unsigned long) 'd', 1));
	for (unsigned int i = 0; i < v.size(); i++) {
		BOOST_CHECK_EQUAL(a.getTopN(6)[i] == v[i], true);
	}
}

BOOST_AUTO_TEST_CASE(sparsify)
{
	NGramConf conf(COUNT, 1);
	NGram a(conf, "abbbbb", 6);
	a.trim(2.0, 3.0);
	NGram b(conf, "c", 1);
	a -= b;
	// Sparsify is called because c has the value -1 and memory needs to be
	// reallocated
	a.trim(0.0, 1.0);
	NGram c(conf, "ab", 2);
	BOOST_CHECK_EQUAL(a, c);
}

void test_extraction(const std::vector<NGramItem> &top_n,
		const unsigned long * const features, const double * const values,
		unsigned int feature_count) {
	for (unsigned int i = 0; i < feature_count; i++) {
		BOOST_CHECK(double_cmp(top_n[i].getValue(), values[i]));
		int fi = i;
		while (fi >= 0 && double_cmp(values[fi], values[i])) {
			fi--;
		}
		fi++;
		bool found = false;
		unsigned int ufi = fi;
		while (ufi < feature_count && double_cmp(values[ufi], values[i])) {
			if (features[ufi] == top_n[i].getFeature())
				found = true;
			ufi++;
		}
		if (!found)
			BOOST_ERROR("Feature not found");
	}
}

